Add the #[typeshare] attribute to any struct or enum you define to generate definitions for that type in the selected output language. #[typeshare]
struct MyStruct { my_name: String, my_age: u32,
} #[typeshare]
enum MyEnum { MyVariant, MyOtherVariant, MyNumber(u32),
}

