Since Typeshare relies on the serde crate for handling serialization and deserialization between Rust types and the generated foreign type definitions, we can use the annotations provided by serde on our Typeshare types. For example, the following Rust definition /// This is a comment.
/// Continued lovingly here
#[typeshare]
#[serde(rename_all = "camelCase")]
pub enum Colors { Red = 0, Blue = 1, /// Green is a cool color #[serde(rename = "green-like")] Green = 2,
} will become the following Typescript definition. /** * This is a comment. * Continued lovingly here */
export const enum Colors { Red = "red", Blue = "blue", /** Green is a cool color */ Green = "green-like",
}

