Within a Rust type, there may be fields or variants that you want Typeshare to ignore. These can be skipped using either the #[serde(skip)] annotation or the #[typeshare(skip)] annotation. For example, this Rust type #[typeshare]
pub struct MyStruct { a: i32, #[serde(skip)] b: i32, c: i32, #[typeshare(skip)] d: i32,
} becomes the following Typescript definition. export interface MyStruct { a: number; c: number;
}
